        <div className='shopbybrand'>
                <div className='brand'>
                    <div className="nikon"><img className='brand1' src="./images/nikon.png"/></div>
            <div className='canon'><img className='brand2' src="./images/canon.jpg"/></div>
            <div className='sony'><img className='brand3' src="./images/sony.jpg"/></div>
            <div className='fujifilm'><img className='brand4' src="./images/fujifilm.png"/></div>
        </div>
        </div>

    )
}
export default Brand;
